import React from "react";

const Cell = (props) => {
  const { isClicked, value, onClick } = props;

  const handleClick = () => {
    bgColor = isClicked ? "#ffffff6d" : "#ffffff2e";
  };

  const bgColor = isClicked ? "#ffffff6d" : "#ffffff2e";

  return (
    <th style={{ backgroundColor: bgColor }} onClick={handleClick}>
      {value}
    </th>
  );
};

export default Cell;
